    swal("MANAGE USER SUBMITED DATA", {
        buttons: {
          cancel: "Dont Delete!",
          FILE: {
            text: "FILE",
            value: "FILE",
          },
          TASK:{
            text:"TASK DETAILS",
            value:"TASK",

          },
          ACCEPT:{
             text:"ACCEPT TASK",
             value:"ACCEPT"
          },
          REVIEW:{
            text:"REQUEST REVIEW",
            value:"REVIEW"
          }




        },
      })
      .then((value) => {
        switch (value) {
            case "FILE":
              break;
              case "TASK":
                break;
                case "REVIEW":
                break;



          case "ACCEPT":
            swal(`ADMINISTRATOR`,`You Are About To Mark task ${id} AS COMPLETED !`,"warning",{
              buttons: {
                cancel: "CANCEL!",
                accept: {
                  text: "accept",
                  value: "accept",
                },
              }
            })
            .then((value)=>{
                 switch (value) {
                   case "accept":
                    swal(`${id}`, "ORDER COMPLETED SUCCESFULLY", "success");
                     break;

                   default:
                     break;
                 }
            })

           // swal(`${username}`, "Deleted Succesfully ACC", "success");
            break;

          default:
            swal("Process Canceled Succesfully!");
        }
      });
}
  const Buttons =()=>{
      return  <>
